import React from 'react';
import { AppBar, Toolbar, Button, Typography, Box, Container } from '@mui/material';
import { Link } from 'react-router-dom';
import './Home.css';
import logo from '../Images/new_logo_image.png';

const Home = () => {
  return (
    <div className="home">
      {/* Navbar */}
      <AppBar position="static" sx={{ backgroundColor: '#d84315', borderRadius: '30px', marginBottom: '20px' }}>
        <Toolbar className="toolbar" sx={{ justifyContent: 'space-between' }}>
          {/* Logo/Title (optional) */}
          <Typography variant="h6" sx={{ fontWeight: 'bold' }}>
            MyWebsite
          </Typography>

          {/* Navigation Buttons */}
          <Box>
            <Button
              component={Link}
              to="/"
              color="inherit"
              sx={{ fontSize: '1.2rem', padding: '10px 20px', marginLeft: '15px' }}
            >
              Home
            </Button>
            <Button
              component={Link}
              to="/blogs"
              color="inherit"
              sx={{ fontSize: '1.2rem', padding: '10px 20px', marginLeft: '15px' }}
            >
              Blogs
            </Button>
            <Button
              component={Link}
              to="/about"
              color="inherit"
              sx={{ fontSize: '1.2rem', padding: '10px 20px', marginLeft: '15px' }}
            >
              About
            </Button>
          </Box>
        </Toolbar>
      </AppBar>

      {/* Centered Logo */}
      <Container maxWidth="md">
        <Box
          display="flex"
          flexDirection="column"
          justifyContent="center"
          alignItems="center"
          height="50vh" // Adjust height according to preference
        >
          <img src={logo} alt="Logo" className="logo-image" style={{ maxWidth: '100%', height: 'auto' }} />
        </Box>

        {/* Content Section */}
        <Box textAlign="center" sx={{ mt: 4 }}>
          <Typography variant="h3" component="h1" gutterBottom>
            Welcome to the Home Page
          </Typography>
          <Typography variant="body1" color="textSecondary">
            This is the home page of the website styled with warm red/orange tones.
          </Typography>
        </Box>
      </Container>
    </div>
  );
};

export default Home;
